import React from "react";
import { Link } from "react-router-dom";

function Index() {
    return (
        <div>
            <h1>[ index 입니당 히힛 ]</h1>
            <Link to="/dashboard">메인 화면으로 이동</Link>
        </div>
    );
}

export default Index;
